import React from "react";
import Navbar from "./Navbar";
// importing Link from react-router-dom to navigate to
// different end points.

const Service = () => {
  return (
    <div>
      <Navbar />
      <div className="top">
        <img src="./assets/bluebg.png"></img>
      </div>
      <div className="content"></div>
    </div>
  );
};

export default Service;
